import { Card, Divider, Table, Space } from 'antd'
import React, { Component } from 'react'
import UserHead from '../../../components/UserHead';
import { createFromIconfontCN } from '@ant-design/icons';
import './OrderTicket.css'

const IconFont = createFromIconfontCN({
    scriptUrl: '//at.alicdn.com/t/font_2779508_swd7x8t93re.js',
})
export default class OrderTicket extends Component {
    render() {

        const columns = [
            {
                title: '序号',
                dataIndex: 'order',
                key: '1',
                align: 'center',
            },
            {
                title: '席别',
                dataIndex: 'level',
                key: '2',
                align: 'center',
            },
            {
                title: '姓名',
                dataIndex: 'name',
                key: '3',
                align: 'center',
            },
            {
                title: '证件号码',
                key: '4',
                dataIndex: 'idCard',
                align: 'center',
            },
            {
                title: '手机号码',
                key: '5',
                dataIndex: 'phone',
                align: 'center',
            },
            {
                title: '操作',
                key: '7',
                render: () => (

                    <IconFont type="anticonicon--shanchu" />

                ),
                align: 'center'
            },
        ];

        const data = [
            {
                key: '1',
                order: 1,
                level: '豪华',
                name: '张三',
                idCard: '510811111111',
                phone: '182222',
            },
        ]

        return (
            <div>
                <UserHead />
                <div className="order-trian-info">
                    <Card
                        title="列车信息"
                        headStyle={{ backgroundColor: '#3B99FC' }}
                        bodyStyle={{ backgroundColor: '#EEF1F8' }}
                    >
                        <p className="order-train-info-p">
                            <strong>2021-07-04</strong>
                            <strong>G2121</strong>
                            次
                            <strong>成都东</strong>
                            站
                            <strong>（17:35开）-北京</strong>
                            站（19:35到）
                        </p>
                    </Card>
                </div>
                <div className="order-passenger-info">
                    <Card
                        title="乘客信息"
                        headStyle={{ backgroundColor: '#3B99FC' }}
                        bodyStyle={{ backgroundColor: '#FFFFFF' }}
                    >
                        乘车人
                        张三 李四
                        <Divider dashed />
                        <Table
                            columns={columns}
                            dataSource={data}
                            bordered
                            rowKey="key"
                            pagination={false}
                        />
                    </Card>
                </div>
            </div>
        )
    }
}
